import React, { Component } from 'react';

class ConfirmTrip extends Component {
  render(){
    return (
    <div className='confirmation'>
      <Header />
      <h2> Confirmation Page </h2>
      <Footer />
    </div>
    )
  }
}

export default ConfirmTrip;
